import React from "react";
import ExpenseItem from "./ExpenseItem";
import './ExpensesList.css'

const ExpensesList = (props) => {
  let expensesContent = <p>No expenses fond.</p>;

  if (props.items.length > 0) {
    expensesContent = props.items.map((item) => {
      return (
        <ExpenseItem
          // We should always add a key value to help react rendering the elements in more efficient way.
          key={item.id}
          title={item.title}
          amount={item.amount}
          date={item.date}
        ></ExpenseItem>
      );
    });
  }

  return <ul className = "expenses-list"></ul>
};

export default ExpensesList;
